import React from 'react'

class PagaYa extends React.Component {
    render() {
        return(
            <React.fragment>
                <figure>
                    <img src="https://cdn.pixabay.com/photo/2017/08/07/19/45/ecommerce-2607114_960_720.jpg"/>
                    
                </figure>
            </React.fragment>
        )
    }
}

export default PagaYa
